class Solution(object):
    def maxSumOfThreeSubarrays(self, nums, k):
        l = len(nums)
        t = list([0] * l for _ in range(3))
        h = list([0] * l for _ in range(3))
        s = [0] * l
        # t[0][k - 1] = s[k - 1] = sum(nums[0:k])
        v = t[0][k - 1] = s[k - 1] = sum(nums[:k])
        h[0][k - 1] = k - 1
        for i in range(k, l):
            v = v + nums[i] - nums[i - k]
            s[i] = v
            if s[i] > t[0][i - 1]:
                t[0][i] = s[i]
                h[0][i] = i
            else:
                t[0][i] = t[0][i - 1]
                h[0][i] = h[0][i - 1]
        #print(t[0])
        for i in range(1, 3):
            for j in range(k * (i + 1) - 1, l):
                if t[i - 1][j - k] + s[j] > t[i][j - 1]:
                    t[i][j] = t[i - 1][j - k] + s[j]
                    h[i][j] = j
                else:
                    t[i][j] = t[i][j - 1]
                    h[i][j] = h[i][j - 1]
        c = h[2][l - 1]
        b = h[1][c - k]
        a = h[0][b - k]
        # self.logVariables(h, nums, s, t)

        return [a - k + 1, b - k + 1, c - k + 1]

    def logVariables(self, h, nums, s, t):
        print(nums)
        print(s)
        print("========")
        for i in range(3):
            print(t[i])
        print("========")
        for i in range(3):
            print(h[i])
s = Solution()

print (s.maxSumOfThreeSubarrays([1,2,1,2,6,7,5,1], 2)) # == [0, 3, 5])
print (s.maxSumOfThreeSubarrays([7,13,20,19,19,2,10,1,1,19], 3)) # == [1, 4, 7])
